import { useQuery } from "@apollo/client";
import { CURRENT_USER_QUERY } from "../components/UseUser";

export default function profile() {
  const { data } = useQuery(CURRENT_USER_QUERY);
  const { email, name } = data;
  return (
    <div>
      <h1>
        <span>{data?.name}</span>
      </h1>
    </div>
  );
}
